import React, { useState, useEffect } from 'react';
import './App.css';
import axios from "axios";

import Table from "./components/Table";

const getInitialResults = async () => {
  return await Promise.all([axios.get("http://localhost:8080/")]);
}

const App = () => {
  useEffect(() => {
    const result = getInitialResults();
    console.log(result);
  }, []);
  return (
    <div className="App">
      <Table />
    </div>
  );
}

export default App;
